window.bookSummaryJSON = "<p>The horde dealt with, Regan turns his attention to the north. As he works to increase his children's and his power, events in the world seem to be against him. Powers continues to grow all around the continent in response to this new player emerging on the map. </p> <p>Louella only wants a few moments of peace to process the changes happening to her and her valley. No one wants to give her that peace as her valley grows to be the center of the continent. </p> <p>Adventurers from both Lecazar and Thonaca rush to Robia Valley as the rumors of gold, power, and adventure only grow stronger.</p>"; 
